export class TableMapper implements IMapper<ITable> {
  getById?(id: number): Promise<ITable> {
    throw new Error('Method not implemented.');
  }
  getByName?(name: string): Promise<ITable> {
    throw new Error('Method not implemented.');
  }
  insert(table: ITable): Promise<void> {
    return new Promise(async (resolve, reject) => {
      const conn = await DBConnector.getConnection();
      conn.query(
        {
          sql: `SET FOREIGN_KEY_CHECKS = 0; DROP TABLE ${process.env.ZSH ? table.TABLE_NAME : table.table_name};`,
        },
        (error, values) => {
          conn.release();
          if (error) {
            Promise.reject();
          }
          return Promise.resolve();
        },
      );
    });
  }

  async insertMany?(tables: ITable[]): Promise<void> {}

  async executeFile(path: string) {
    const conn = await DBConnector.getConnection();
    let queries = fs.readFileSync(path, { encoding: 'utf8' }).split(';');
    queries = queries.map(query => {
      const v = query.replace(/(\r\n|\n|\r);/gm, '').trim();
      return v;
    });
    conn.query(queries.join(';'), (error, value) => {
      conn.release();
      if (error) {
        console.error(error.message);
        return Promise.reject(error);
      }
      Promise.resolve();
    });
  }

  async dropTable(table: string): Promise<void> {
    return new Promise(async (resolve, reject) => {
      const conn = await DBConnector.getConnection();
      conn.query(
        {
          sql: `SET FOREIGN_KEY_CHECKS = 0; drop table ${MYSQL_DATABASE}.${table};`,
        },
        (error, values) => {
          conn.release();
          if (error) {
            console.log(error);
            reject(error);
          }
          resolve();
        },
      );
    });
  }

  async dropAllConstraints(): Promise<void> {
    return new Promise(async (resolve, reject) => {
      const conn = await DBConnector.getConnection();
      conn.query(
        {
          sql: `SELECT concat('alter table ',table_schema,'.',table_name,' DROP FOREIGN KEY ',constraint_name,';')
          FROM information_schema.table_constraints
          WHERE constraint_type='FOREIGN KEY'
          AND table_schema=DATABASE(); `,
        },
        (error, values) => {
          conn.release();
          if (error) {
            reject();
          }
          resolve();
        },
      );
    });
  }

  async dropAll(): Promise<void> {
    return new Promise(async (resolve, reject) => {
      const tables = await this.getAll().then(tables =>
        tables.map(table => `drop table ${process.env.ZSH ? table.TABLE_NAME : table.table_name}`),
      );
      tables.unshift('SET FOREIGN_KEY_CHECKS = 0');
      await this.dropAllConstraints();
      const conn = await DBConnector.getConnection();
      conn.query(
        {
          sql: tables.join(';'),
        },
        (error, values) => {
          conn.release();
          if (error) {
            reject();
          }
          resolve();
        },
      );
    });
  }

  deleteByName?(name: string): Promise<void> {
    throw new Error('Method not implemented.');
  }
  deleteById?(id: number): Promise<void> {
    throw new Error('Method not implemented.');
  }
  deleteAll?(): Promise<void> {
    throw new Error('Method not implemented.');
  }

  getAll(): Promise<ITable[]> {
    return new Promise(async (resolve, reject) => {
      const conn = await DBConnector.getConnection();
      conn.query(
        {
          sql: `SELECT
      table_name
      FROM
      information_schema.tables
      WHERE
      table_schema = DATABASE();`,
        },
        (error, results) => {
          conn.release();
          if (error) {
            console.error(colors.red('error'), error);
            reject(error);
          }
          resolve(results);
        },
      );
    });
  }
}

import { IAccount } from '../interfaces/IAccount';
import { AccountMapper } from '../database/AccountMapper';
import { MovementMapper } from '../database/MovementMapper';

export class AccountHandler {
  async transferAmountTo(currentAccountNumber: number, amount: number, targetAccountNumber: number): Promise<void> {
    // -- Check if target account exist
    // -- Check current account exist

    amount = Math.abs(amount);

    const am = new AccountMapper();
    const mm = new MovementMapper();

    const currentAccount: IAccount = await am.getByNumber(currentAccountNumber);
    const targetAccount: IAccount = await am.getByNumber(targetAccountNumber);

    if (!currentAccount || !targetAccount) throw Error('current account or target account does not exist');
    // -- Accounts exist procceed with transfer

    await Promise.all([
      am.updateAccountBalanceByNumber(currentAccount.number!, currentAccount.balance - amount),
      am.updateAccountBalanceByNumber(targetAccount.number!, targetAccount.balance + amount),
      mm.insert({
        accountFrom: currentAccount.number!,
        accountTo: targetAccount.number!,
        amount,
        time: Date(),
      }),
    ]);
  }
}

